  \"2016-07-27T22:20:51.348683\",\n\t\"name\": \"chronic-wasting-disease-surveillance-and-contingency-plan-parker-river-national-wildlife-r\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Chronic Wasting Disease (CWD) is a transmissible
  spongiform encephalopathy (TSE) of deer and elk in North America.  The causative
  agent of CWD is thought to be abnormally shaped prion proteins.  This plan is established
  to provide a framework for surveillance, monitoring and disease response at Parker
  River National Wildlife Refuge in collaboration with the Massachusetts Department
  of Fisheries and Wildlife (MassWildlife).  The goals of this plan are: (1) to prevent
  or minimize CWD impact on Refuge deer population; (2) to provide early detection
  of CWD on refuge lands in coordination with the State; (3) to collaborate with and
  assist state agencies, tribes, and other partners in addressing CWD; and (4) to
  participate as possible with states, tribes, and other partners on surveillance,
  monitoring, and research.  A paper on surveillance strategies for detecting CWD
  is included as an appendix to the plan.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
